import React, { Component } from "react";
import { connect } from "react-redux";

class Dashboard extends Component {
  render() {
    return <div>hi {this.props.authedUser}</div>;
  }
}

function mapStateToProps({ authedUser }) {
  return {
    authedUser,
  };
}
export default Dashboard;
